import Header from "./common/Header";
export default function Product() {
  return (
    <>
      <Header />
      <section>
        <div>
          <table>
            <thead>
              <th>Id</th>
              <th>Name</th>
            </thead>
          </table>
          <tbody></tbody>
        </div>
      </section>
    </>
  );
}
